function upload(url) {
  const response = Cloudinary.uploader.upload(url, {
    folder: '/enlighten-me-daily',
    api_key: process.env.CLOUDINARY_KEY,
    api_secret: process.env.CLOUDINARY_SECRET,
    cloud_name: process.env.CLOUDINARY_NAME,
  })
  return response;
}

urls.map(url => {
  upload(url)
})
